INSERT INTO `grid_service` VALUES (1,'AnalyticalService',NULL,'ChromosomalSegmentOverlapAcrossSources','2009-08-19 11:33:24','ChromosomalSegmentOverlapAcrossSources','http://linuxcomp64.wustl.edu:9880/wsrf/services/cagrid/ChromosomalSegmentOverlapAcrossSources','1.2',1,NULL),(2,'DataService',NULL,'CaDSRDataService','2009-08-19 11:33:24','CaDSRDataService','http://cadsr-dataservice-sandbox.nci.nih.gov:80/wsrf/services/cagrid/CaDSRDataService','1.2',2,NULL),(3,'DataService',NULL,'HelloWorld','2009-08-19 11:33:24','HelloWorld','https://itd107.cc.emory.edu:8443/wsrf/services/cagrid/HelloWorld','1.2',NULL,NULL),(4,'AnalyticalService','The EVS grid service provides access to data semantics and controlled terminology as managed by the NCI Enterprise Vocabulary Service.','EVSGridService','2009-08-19 11:33:24','EVSGridService','http://evs.training.cagrid.org:8080/wsrf/services/cagrid/EVSGridService','1.0',4,NULL),(5,'AnalyticalService','The AuthenticationService serves as an integration point between local identity management and caGrid identity federation. This implementation exposes the NCICB\'s Common Securty Module (CSM) as an Identity Provider (IdP) that may be used in conjuction with the dorian Identity federation service.','AuthenticationService','2009-08-19 11:33:24','AuthenticationService','https://cagrid.emory.edu:8443/wsrf/services/cagrid/AuthenticationService','1.0',5,NULL),(6,'AnalyticalService','The Global Model Exchange (GME) service provides registry of XML Schemas which define the syntax of data exchanged on the grid.','GlobalModelExchange','2009-08-19 11:33:24','GlobalModelExchange','https://globalmodelexchange.training.cagrid.org:8443/wsrf/services/cagrid/GlobalModelExchange','1.3',6,NULL),(7,'DataService','caTissueSuite v1.1 Washu Test instance','Washu-CaTissueSuite','2009-08-19 11:33:24','Washu-CaTissueSuite','https://128.252.227.122:8443/wsrf/services/cagrid/CaTissueSuite','1.1 RC4',7,3),(8,'AnalyticalService',NULL,'ChromosomalSegmentOverlapAcrossSample